import React from 'react';
import ReactDOM from 'react-dom/client';
import App from "./components/app/app";

const Card = {
  CardRender: string,
} as const;


const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement,
);

root.render(
  <React.StrictMode>
    <App
    cardRender = {Card.CardRender}/>
  </React.StrictMode>,
);
